import React from "react";

export default function Footer() {
    return (
        <footer className="py-4 bg-dark">
            <div className="container-fluid px-4">
                <p className="m-2 text-center text-white">Common Cents Collaborative ("Common Cents") is not a financial advisor, investment advisor, legal advisor, accountant, or other certified financial professional. All opinions expressed by Common Cents Collaborative are intended for informational purposes and should not be viewed as legal or financial advice.</p></div>
        </footer>
    );
}
